  container: {
    minHeight: "100vh",
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
    backgroundColor: "#f8f8f8",
  },
  text: {
    fontSize: "1.8rem",
    color: "#666",
    fontStyle: "italic",
  },
};

export default Login;
